import{_ as e,o as a,c as r,a2 as i}from"./chunks/framework.C766EroN.js";const u=JSON.parse('{"title":"Virtual Machine 虚拟机","description":"NetBox VirtualMachine 模型中英对照","frontmatter":{"title":"Virtual Machine 虚拟机","description":"NetBox VirtualMachine 模型中英对照"},"headers":[],"relativePath":"tech-share/netbox/4.5.1/community/data-model/virtualization/virtualmachine.md","filePath":"tech-share/netbox/4.5.1/community/data-model/virtualization/virtualmachine.md"}'),o={name:"tech-share/netbox/4.5.1/community/data-model/virtualization/virtualmachine.md"};function n(d,t,s,h,l,c){return a(),r("div",null,[...t[0]||(t[0]=[i('<h1 id="virtual-machine-虚拟机" tabindex="-1">Virtual Machine / 虚拟机 <a class="header-anchor" href="#virtual-machine-虚拟机" aria-label="Permalink to &quot;Virtual Machine / 虚拟机&quot;">​</a></h1><p><em>内容来源 / Source: <a href="https://netboxlabs.com/docs/netbox/models/virtualization/virtualmachine/" target="_blank" rel="noreferrer">NetBox Labs Documentation</a> | 如有侵权请<a href="/contact.html">联系我们</a>删除</em></p><h2 id="概述-overview" tabindex="-1">概述 | Overview <a class="header-anchor" href="#概述-overview" aria-label="Permalink to &quot;概述 | Overview&quot;">​</a></h2><p><strong>中文：</strong> 虚拟机 (VM) 表示托管在<a href="/tech-share/netbox/4.5.1/community/data-model/virtualization/cluster.html">集群</a>内的虚拟计算实例。每台 VM 必须分配至<a href="/tech-share/netbox/4.5.1/community/data-model/dcim/site.html">站点</a>和/或集群，可选择性分配至集群内特定宿主<a href="/tech-share/netbox/4.5.1/community/data-model/dcim/device.html">设备</a>。VM 可挂载虚拟<a href="/tech-share/netbox/4.5.1/community/data-model/virtualization/vminterface.html">接口</a>，不支持物理组件。当 VM 的接口分配了 IP 时，可指定主 IPv4/IPv6。</p><p><strong>English:</strong> A virtual machine (VM) represents a virtual compute instance hosted within a cluster. Each VM must be assigned to a site and/or cluster, and may optionally be assigned to a particular host device within a cluster. VMs may have virtual interfaces assigned, but do not support physical components. When a VM has interfaces with IP addresses, a primary IPv4 and IPv6 can be designated.</p><hr><h2 id="字段-fields" tabindex="-1">字段 | Fields <a class="header-anchor" href="#字段-fields" aria-label="Permalink to &quot;字段 | Fields&quot;">​</a></h2><table tabindex="0"><thead><tr><th>字段 Field</th><th>中文</th><th>English</th></tr></thead><tbody><tr><td><strong>Name</strong></td><td>VM 配置名称，在集群和租户内唯一</td><td>The VM&#39;s configured name. Must be unique to cluster and tenant</td></tr><tr><td><strong>Role</strong></td><td>功能<a href="/tech-share/netbox/4.5.1/community/data-model/dcim/devicerole.html">角色</a></td><td>The functional role assigned to the VM</td></tr><tr><td><strong>Status</strong></td><td>运行状态</td><td>The VM&#39;s operational status</td></tr><tr><td><strong>Start on boot</strong></td><td>宿主机「开机自启」设置</td><td>The start on boot setting from the hypervisor</td></tr><tr><td><strong>Site &amp; Cluster</strong></td><td>所属站点和/或集群</td><td>The site and/or cluster to which the VM is assigned</td></tr><tr><td><strong>Device</strong></td><td>宿主物理设备</td><td>The physical host device on which this VM resides</td></tr><tr><td><strong>Platform</strong></td><td>操作系统<a href="/tech-share/netbox/4.5.1/community/data-model/dcim/platform.html">平台</a></td><td>A VM may be associated with a platform to indicate its OS</td></tr><tr><td><strong>Primary IPv4 &amp; IPv6</strong></td><td>主 IPv4/IPv6 管理地址</td><td>Each VM may designate one primary IPv4 and/or IPv6</td></tr><tr><td><strong>vCPUs</strong></td><td>虚拟 CPU 数量（可为小数，如 1.5）</td><td>The number of virtual CPUs provisioned</td></tr><tr><td><strong>Memory</strong></td><td>运行内存，单位 MB</td><td>The amount of running memory provisioned, in megabytes</td></tr><tr><td><strong>Disk</strong></td><td>磁盘容量，单位 MB（无虚拟磁盘时 direct 修改；否则为所有磁盘之和）</td><td>Disk storage in MB. Editable only when no discrete virtual disks</td></tr><tr><td><strong>Serial Number</strong></td><td>可选序列号（VM 不强制唯一）</td><td>Optional serial number assigned to this VM</td></tr></tbody></table><hr><h2 id="官方文档" tabindex="-1">官方文档 <a class="header-anchor" href="#官方文档" aria-label="Permalink to &quot;官方文档&quot;">​</a></h2><ul><li><a href="https://netboxlabs.com/docs/netbox/models/virtualization/virtualmachine/" target="_blank" rel="noreferrer">Virtual Machine 完整文档 →</a></li></ul>',11)])])}const v=e(o,[["render",n]]);export{u as __pageData,v as default};
